import React, { useContext, useState } from "react";
import Login from "./component/login";
import { BrowserRouter, Route, Link,NavLink, Routes } from "react-router-dom";
import Admin from "./component/admin";
import User from "./component/user";
import Signup from "./component/signup";
import Landing from "./component/landing";
import Card from "./component/card";
import AdminLogin from "./component/adminlogin";
import AdminSignup from "./component/adminsignup";
import formContext from "./context/form/formcontext";
import Contact from "./component/contact";



function App() {

  const a = useContext(formContext)

  const [num, inc] = useState(0);

  console.log('nav')

  let activeStyle = {
    textDecoration:'underline'
  }

  let activeClassName = 'underline'



  return (
    <BrowserRouter>

      <nav style={{ background: 'white',textDecoration:'none' }} >



        <div style={{ display: 'flex', padding: '2.5% 0', margin: '0 auto', textAlign: 'center', justifyContent: 'center' }} className="nav-btns">

        <nav>
      <ul>
        <li>
          <NavLink
            to="messages"
            style={({ isActive }) =>
              isActive ? activeStyle : undefined
            }
          >
            Messages
          </NavLink>
        </li>
        <li>
          <NavLink
            to="tasks"
            className={({ isActive }) =>
              isActive ? activeClassName : undefined
            }
          >
            Tasks
          </NavLink>
        </li>
        <li>
          <NavLink to="tasks">
            {({ isActive }) => (
              <span
                className={
                  isActive ? activeClassName : undefined
                }
              >
                Tasks
              </span>
            )}
          </NavLink>
        </li>
      </ul>
    </nav>

          <Link to={'/'} id="nav-2"

            onClick={() => {
              document.getElementById('nav-2').style.borderBottom = 'solid 5px skyblue';

              document.getElementById('nav-1').style.borderBottom = '';
              document.getElementById('nav-3').style.borderBottom = '';
            }}

            style={{ textDecoration: 'none', color: 'black', padding: '0 5%', paddingBottom: '1%', fontWeight: 'bolder' }}>Home</Link>


          <Link to={'/contact'} id="nav-3"

            onClick={() => {
              document.getElementById('nav-3').style.borderBottom = 'solid 5px skyblue';

              document.getElementById('nav-2').style.borderBottom = '';
              document.getElementById('nav-1').style.borderBottom = '';
            }}

            style={{ textDecoration: 'none', color: 'black', padding: '0 5%', paddingBottom: '1%', fontWeight: 'bolder' }}>Contact Us</Link>

          {!localStorage.getItem('auth-token') ? <Link to={'/login'} id='nav-1' onClick={() => {



            document.getElementById('nav-1').style.borderBottom = 'solid 5px skyblue';

            document.getElementById('nav-2').style.borderBottom = '';
            document.getElementById('nav-3').style.borderBottom = '';



          }} style={{ textDecoration: 'none', color: 'black', padding: '0 5%', borderColor: 'skyblue', paddingBottom: '1%', fontWeight: 'bolder' }}>Login/Signup</Link> :


              <Link style={{ textDecoration: 'none', color: 'black', padding: '0 5%', borderColor: 'skyblue', paddingBottom: '1%', fontWeight: 'bolder' }}  id="nav-1" className="dropdown">
                <button className="btn btn-secondary dropdown-toggle" type="button" data-bs-toggle="dropdown" aria-expanded="false">
                  <img src="./user.png" width={'25px'} alt="" />
                </button>
                <ul className="dropdown-menu" style={{width:'100%'}}>
                  <li style={{ textDecoration: 'none', color: 'black', padding: '0.5rem 10%', borderColor: 'skyblue' }}><Link style={{ textDecoration: 'none', color: 'black', padding: '0.5rem 10%', borderColor: 'skyblue', fontWeight: 'bolder' }} to={'/user'} >DashBoard</Link></li>
                  <li style={{ textDecoration: 'none', color: 'black', padding: '0.5rem 10%', borderColor: 'skyblue' }}><Link onClick={() => { localStorage.removeItem('auth-token'); inc(prev => prev + 1) }} style={{ textDecoration: 'none', color: 'black', padding: '0.5rem 10%', borderColor: 'skyblue', fontWeight: 'bolder' }} to={'/login'}>Logout</Link></li>
                  <li style={{ textDecoration: 'none', color: 'black', padding: '0.5rem 10%', borderColor: 'skyblue' }}><Link onClick={() => { localStorage.removeItem('auth-token-admin'); inc(prev => prev + 1) }} style={{ textDecoration: 'none', color: 'black', padding: '0.5rem 10%', borderColor: 'skyblue', fontWeight: 'bolder' }} to={'/adminlogin'}>Logout-admin</Link></li>
                </ul>
              </Link>




          }


        </div>

      </nav>

      <Routes>
        <Route path="/" element={< Landing />} />
        <Route path="/login" element={<Login />} />

        <Route path="admin" element={<Admin />} />

        <Route path="user" element={<User />} />

        <Route path="signup" element={<Signup />} />

        <Route path="adminsignup" element={<AdminSignup />} />

        <Route path="card" element={<Card />} />

        <Route path="/contact" element={<Contact />} />

        <Route path="adminlogin" element={<AdminLogin />} />
      </Routes>
    </BrowserRouter>
  )
}

export default App;
